
inline std::string codesStringToNormalString(std::string s)
{
	std::stringstream ss;
	ss << s;
	std::string res;
	int32_t ch;
	while (ss.good())
	{
		ss >> ch;
		res.push_back((char)ch);
	}
	return res;
}
